package Cache;

import org.apache.commons.compress.compressors.CompressorException;
import org.apache.commons.compress.compressors.CompressorOutputStream;
import org.apache.commons.compress.compressors.CompressorStreamFactory;

import java.io.*;
import java.util.zip.GZIPInputStream;

public class Compression {

    public static String gzipCompress(String data) throws IOException {
        ByteArrayOutputStream bos = new ByteArrayOutputStream(data.length());
        try {
            CompressorOutputStream gzipStream = new CompressorStreamFactory()
                    .createCompressorOutputStream(CompressorStreamFactory.GZIP, bos);
            gzipStream.write(data.getBytes());
            gzipStream.close();
            byte[] compressed = bos.toByteArray();
            bos.close();
            return new String(compressed);
        } catch (CompressorException e) {
            e.printStackTrace();
        } finally {
            bos.close();
        }
        return null;
    }

    public static String gzipDecompress(byte[] compressed) throws IOException {
        ByteArrayInputStream bis = new ByteArrayInputStream(compressed);
        GZIPInputStream gis = new GZIPInputStream(bis);
        BufferedReader br = new BufferedReader(new InputStreamReader(gis, "UTF-8"));
        StringBuilder sb = new StringBuilder();
        String line;
        while ((line = br.readLine()) != null) {
            sb.append(line);
        }
        br.close();
        gis.close();
        bis.close();
        return sb.toString();
    }

    public static void main(String[] args) throws IOException, CompressorException {
        long start = System.currentTimeMillis();
        StringBuilder stringBuilder = new StringBuilder();
//        stringBuilder.append( ""+""+""+""+""+""+""+"");

        ByteArrayOutputStream bos = new ByteArrayOutputStream(stringBuilder.toString().length());
        CompressorOutputStream xz = new CompressorStreamFactory()
                .createCompressorOutputStream(CompressorStreamFactory.GZIP, bos);
//        compress(image);


        xz.write(stringBuilder.toString().getBytes());
        xz.close();
        byte[] compressed = bos.toByteArray();
        bos.close();

        long end = System.currentTimeMillis();
        System.out.println("TOTAL TIME " + (end - start));
        System.out.println("Compressed SIZE " + compressed.length);
        System.out.println("Uncompressed Size " + stringBuilder.toString().getBytes().length);
    }
}
